import React, { useState } from 'react';
import { Routes, Route } from 'react-router-dom';
import PersonalDetails from './PersonalDetails';
import IdentityDetails from './IdentityDetails'
import IntermediateDetails from './IntermediateDetails';
import AcademicRecord from './Forms/ApplicationBPT/AcademicRecord';
import CourseDetails from '../../Forms/ApplicationBPT/CourseDetails'
import ContactInformation from './Forms/ApplicationBPT/ContactInformation';
import DocumentsUpload from './Forms/ApplicationBPT/DocumentsUpload';


const ApplicationTable = () => {
  const [formData, setFormData] = useState({
    administrativeDetails: {},
    applicationFeeDetails: {},
    personalDetails: {},
    identityDetails: {},
    contactInformation: {},
    intermediateDetails: {},
    courseDetails: {},
    academicRecord: {},
    documentsUpload: {}
  });

  return (
    <Routes>


      <Route path="personal" element={<PersonalDetails formData={formData} setFormData={setFormData} />} />
      <Route path="identity" element={<IdentityDetails formData={formData} setFormData={setFormData} />} />
      <Route path="contact" element={<ContactInformation formData={formData} setFormData={setFormData} />} />
      <Route path="intermediate" element={<IntermediateDetails formData={formData} setFormData={setFormData} />} />
      <Route path="course" element={<CourseDetails formData={formData} setFormData={setFormData} />} />
      <Route path="record" element={<AcademicRecord formData={formData} setFormData={setFormData} />} />
      <Route path="upload" element={<DocumentsUpload formData={formData} setFormData={setFormData} />} />
      <Route path="report" element={<ApplicationReportBPT formData={formData} />} />
    </Routes>
  );
};

export default ApplicationTable;
